import "./expenses"
import Expenseitem from "./expenseitem"
function Expenses(prop){
    <div>

    <Expenseitem 
      title={props.list.expenses[0].title}
       price={props.list.expenses[0].amount} 
       date={props.list.expenses[0].date} />  
      <Expenseitem 
      title={expenses[1].title} 
      price={expenses[1].amount}
       date={expenses[1].date}/> 
      <Expenseitem title={expenses[2].title}
       price={expenses[2].amount} 
       date={expenses[2].date}/> 
      <Expenseitem title={expenses[3].title}
       price={expenses[3].amount} 
       date={expenses[3].date}/> 
    </div>
}
